Forwarded from pavell French presidential election results

First round:
Emmanuel Macron - 28.6%;
Marine Le Pen - 24.4%;
Jean-Luc Melanchon - 20.2%;
Eric Zemmour - 6.8%;
Valérie Pécresse, 4.6%.   

The results of Macron and Le Pen are fairly correctly predicted by the polls. The information that the two leaders were going toe-to-toe was, as one would expect, an "animation" designed to attract Macron's electorate to the polls (so that they would not lie on their couches, thinking that everything had been solved).   

Melanchon's excellent result gives him a chance of becoming the leader of the revived left in the National Assembly elections and competing with Macron's supporters. That is, Melanchon has a chance to lead the left-wing parliamentary opposition to Macron and his government. Or even get into the governing coalition, if Macron's supporters do not have enough votes at the end of the National Assembly elections.   

Valérie Pécrès' failure. She also called for a vote for Macron, accusing Le Pen of being close to Vladimir Putin. Apparently, she can indeed count on a seat in the government. Why else? But for non - https://t.me/madam_secretar/9167 - source : Madame Secretary
